  <script>
    let date = document.querySelector('.date');
    let touxiang = document.querySelector('.touxiang')
    let csmtime = document.querySelector('.csmtime')
    let csmdate = document.querySelector('.csmdate')
    function getDate() {
      let date = new Date();
      let nowMouth = date.getMonth() + 1;
      nowMouth = nowMouth < 10 ? '0' + nowMouth : nowMouth;
      let nowDate = date.getDate();
      nowDate = nowDate < 10 ? '0' + nowDate : nowDate;
      let nowHour = date.getHours();
      nowHour = nowHour < 10 ? '0' + nowHour : nowHour;
      let nowMinute = date.getMinutes();
      nowMinute = nowMinute < 10 ? '0' + nowMinute : nowMinute;
      return '(' + nowMouth + '月' + nowDate + '日' + nowHour + ':' + nowMinute + '获取)';
    }
    // date.addEventListener('click', function () {
      let html = getDate();
      date.innerHTML = html
    // })


    let flag = false
    setInterval(() => {
      flag = !flag
      if (flag) {
        touxiang.style.borderColor = '#0006ff'
      } else {
        touxiang.style.borderColor = '#afbbff'
      }
    }, 1000);

  </script>
